import React from 'react';
import Header from '../components/Header';
import Footer from '../components/Footer';
import ProductCard from '../components/ProductCard'; // Создадим этот компонент
import '../styles/Products.css';

const Products = () => {
  // Пример данных товаров (замените на реальные из API/базы данных)
  const products = [
    { id: 1, name: 'Кроссовки LinIng Storm', price: 8990, image: '../assets/product1.jpg' },
    { id: 2, name: 'Футболка LinIng Urban', price: 2490, image: '../assets/product2.jpg' },
  ];

  return (
    <div className="app">
      <Header />
      <main className="products-page">
        <h1 className="page-title">ТОВАРЫ</h1>
        <div className="products-grid">
          {products.map(product => (
            <ProductCard key={product.id} product={product} />
          ))}
        </div>
      </main>
      <Footer />
    </div>
  );
};

export default Products;
